INSERT INTO Animes(AnimeID, AnimeTitle, AnimeDesc, TypeID, AiredBegin, AiredEnd, Premiered, Duration, PosterUrl) VALUES (630, CONCAT('Gokujou Seitokai'), CONCAT('Randou Rino is a young girl with a head full of air and a talking puppet on her hand. She is accepted into the illustrious Gokujou all-girl', CHAR(39), 's school, and is summarily, almost curiously, accepted as part of the even more illustrious Gokujou Student Council, who has more power and business ventures than most large businesses. Now a part of the student council, she befriends the talented members of the Gokujou Student Council, leaving one to wonder how a girl with seemingly no talents or redeeming qualities would get chosen for such a group. <br><br>(Source: ANN)'), 1, '2005-04-07', '2005-09-29', 'Spring 2005', '25 min. per ep.', 'https://cdn.myanimelist.net/images/anime/7/18714.jpg');
